export const display = (x) => {
    return {
      type: "APPEND_NUM",
      char: x,
    };
  };

  export const back = () => {
    return {
      type: "BACKSPACE_NUM"
    };
  };

  export const equals = () => {
    return {
        type: "EQUALS"
    }
  }

  export const sqrt = () => {
    return {
        type: "SQRT"
    }
  }
